    mapping(address=>mapping(address=>mapping(uint256=>bool))) public _wallet2operator2license2withdrawapproved;
    mapping(address=>mapping(address=>mapping(uint256=>uint256))) public _wallet2operator2license2withdrawexpire;
    mapping(address=>mapping(address=>mapping(uint256=>uint256))) public _wallet2operator2license2withdrawamount;
    mapping(address=>mapping(address=>mapping(uint256=>uint256))) public _wallet2operator2license2withdrawnftea;
    mapping(address=>mapping(address=>mapping(uint256=>uint256))) public _wallet2operator2license2withdrawnfteaquantity;
    mapping(address=>mapping(address=>mapping(uint256=>address))) public _wallet2operator2license2withdrawtoken;
    mapping(address=>bool) private _isW;
