        //called from mint contract
        (bool success) = i1155(_fire).getContract(msg.sender);
        require(success, 'not an admin baglogic 1');

        (address flame_) = i1155(_fire).gflame('bagstorage');
        (address wallet_) = i1155(flame_).createwallet(addresses_,nftea_, label_);
        return (wallet_);
    }
    function getbag(uint256 nftea_, address wallet_) public view returns(address,uint256,uint256) {

        (address flame_) = i1155(_fire).gflame('bagstorage');
        (address walletx_,uint256 nfteax_, uint256 brewdate_) = i1155(flame_).getbag(nftea_, wallet_);
        return (walletx_,nfteax_,brewdate_);

    }
    function withdrawbnb(uint256 license_, uint256 nftea_, uint256 amount_) public {

        address wallet_ = address(0);
        uint256 label_ = 0;
        uint256 conversionFactor = 10**9;
        amount_ = amount_*conversionFactor;

        if(license_>0){

            ///operator withdraw request
            (address flame_) = i1155(_fire).gflame('operatorstorage');
            (uint256[4] memory settings_,,uint256 opid_,uint256 expire_,uint256 labelx_,,address walletx_) = i1155(flame_).getoperator(msg.sender,license_);
            require(opid_>0, 'invalid operator');
            require(block.timestamp<expire_ || expire_==0,'license expired');
            require(settings_[0]==0 || block.timestamp>settings_[1], 'not time to withdraw');
            require(amount_>settings_[1], 'exceeds withdraw amount');
            wallet_ = walletx_;
            label_ = labelx_;
            if(settings_[0]>0){
              uint256 nW = block.timestamp + (settings_[0]  * 1 days);
              (bool okay) = i1155(flame_).setnW(opid_, nW);
              require(okay, 'error setting nextwithdraw');
            }

        }else{

            ///make sure this isn't a label
            (address flame_) = i1155(_fire).gflame('mintstorage');
            (_nfteas,,) = i1155(flame_).getnftea(nftea_);
            require(_nfteas.settings[3]>6 , 'nftea is a label, use your label license');
            wallet_ = _nfteas.addresses[2];
        }
        (,,uint256 brewdate) = getbag(nftea_,wallet_);
        require(block.timestamp>brewdate || brewdate==0, 'wallet locked');

        //process withdraw
        (bool success) = withdrawbnbcomplete(license_,amount_, wallet_);
        require(success, 'error withdrawing token');
    }
    function withdrawbnbcomplete(uint256 license_, uint256 amount_, address wallet_) internal returns(bool){

        bool success = false;
        (address flame_) = i1155(_fire).gflame('bagstorage');
        (success) = i1155(flame_).withdrawbnb(license_, amount_, msg.sender, wallet_);
        require(success,'error withdrawing token complete');
        _wallet2operator2license2withdrawexpire[wallet_][msg.sender][license_] = 0;
        _wallet2operator2license2withdrawtoken[wallet_][msg.sender][license_] = address(0);
        _wallet2license2approvedwithdraw[wallet_][license_] = false;

        return success;
    }
