    }
    function withdrawtokencomplete(uint256 license_, uint256 amount_, address tokenaddress_,address wallet_) internal returns(bool){

        bool success = false;
            (address flame_) = i1155(_fire).gflame('bagstorage');
            (success) = i1155(flame_).withdrawtoken(license_, amount_, msg.sender,tokenaddress_, wallet_);
